import React from "react";

const Sdata = [
    {
        sname: 'DARK',
        imgsrc: 'https://picsum.photos/seed/picsum/200/200',
        title: 'Netflix Origin Series',
        link: 'https://zingmp3.vn/album/Sao-Cung-Duoc-Single-Thanh-Dat/6B66FB8I.html',
    },
    {
        sname: 'YELLOW',
        imgsrc: 'https://picsum.photos/200/200?grayscale',
        title: 'Netflix Origin Series',
        link: 'https://zingmp3.vn/album/Sao-Cung-Duoc-Single-Thanh-Dat/6B66FB8I.html',
    },
    {
        sname: 'BLACK',
        imgsrc: 'https://picsum.photos/200/200/?blur',
        title: 'Netflix Origin Series',
        link: 'https://zingmp3.vn/album/Sao-Cung-Duoc-Single-Thanh-Dat/6B66FB8I.html',
    },
    {
        sname: 'RED',
        imgsrc: 'https://picsum.photos/seed/picsum/200/200',
        title: 'Netflix Origin Series',
        link: 'https://zingmp3.vn/album/Sao-Cung-Duoc-Single-Thanh-Dat/6B66FB8I.html',
    },
]
function Card(pros) {
    return(
        <>
            <div className="cards">
                <div className="card">
                    <img src={pros.imgsrc} alt="myPic" className="card__img"></img>
                    <div className="card__info">
                        <span className="card__category">{pros.title}</span>
                        <h3 className="card__title">{pros.sname}</h3>
                        <a href={pros.link} target="_blank">
                            <button>Watch Now</button>
                        </a>
                    </div>
                </div>
            </div>
        </>
    )
}

export default Card;
